var title_f13_35_13880="Stonefish";
var content_f13_35_13880=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F82851&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F82851&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 524px\">",
"   <div class=\"ttl\">",
"    Stonefish",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 378px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The stonefish is found in the Indian and Pacific Oceans and has 13 spines along the back. Envenomation is very painful. Treatment consists of hot water immersion, oral or parenteral analgesia, and local wound care. Stonefish antivenom is available for patients whose pain does not resolve with initial therapy.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Photo courtesy of Sean Mack. Reproduced with permission under the Creative Commons Attribution. Available from: file://en.wikipedia.org/wiki/Synanceia.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
