"   <div class=\"block mop drugH1Div\" id=\"F169039\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Monitoring Parameters",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Monitor CBC and chemistry profile, liver enzymes; in patients with an increased risk for renal failure (CHF or decreased renal function, taking ACE inhibitors or diuretics, elderly), monitor urine output and BUN/serum creatinine",
"    </p>",
"   </div>",
