"   <div class=\"block pha drugH1Div\" id=\"F169028\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Reversibly inhibits cyclooxygenase-1 and 2 (COX-1 and 2) enzymes, which results in decreased formation of prostaglandin precursors; has antipyretic, analgesic, and anti-inflammatory properties",
"    </p>",
"    <p style=\"text-indent:0em;margin-top:2em;\">",
"     Other proposed mechanisms not fully elucidated (and possibly contributing to the anti-inflammatory effect to varying degrees), include inhibiting chemotaxis, altering lymphocyte activity,  inhibiting neutrophil aggregation/activation, and decreasing proinflammatory cytokine levels.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F169046\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Onset of action: Analgesic: 2-4 hours; Maximum anti-inflammatory effect: A few days",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: &ge;80%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: V",
"     <sub>",
"      d",
"     </sub>",
"     :",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;margin-right:0em;margin-top:0em;text-align:justify;\">",
"     Immediate release: Adults:0.4 L/kg",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;margin-right:0em;margin-top:0em;text-align:justify;\">",
"     Extended release: Adults: 0.57 L/kg; Children (6-16 years): 0 .08 L/kg",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: &ge;99%, primarily albumin",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Hepatic",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Bioavailability: 100%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: Terminal: Adults: 5-8 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;margin-right:0em;margin-top:0em;text-align:justify;\">",
"     Extended release: Children (6-16 years): 12 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak, serum:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;margin-right:0em;margin-top:0em;text-align:justify;\">",
"     Immediate release: Adults: 1-2 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;margin-right:0em;margin-top:0em;text-align:justify;\">",
"     Extended release: Extended release: 5-7 hours, increased 1.4-3.8 hours with food",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine 73% (1% unchanged); feces 16%",
"    </p>",
"   </div>",
