var title_f13_35_13885="Mastoiditis Rx regimens";
var content_f13_35_13885=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F61644&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F61644&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Suggested empiric parenteral antibiotic regimens for the treatment of acute mastoiditis in children*",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"2\" width=\"50%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Antibiotic",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dose",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        For patients without a history of recurrent otitis media or recent antibiotic therapy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Vancomycin",
"        <sup>",
"         &bull;&Delta;",
"        </sup>",
"       </td>",
"       <td>",
"        60 mg/kg per day divided every 6 hours (maximum daily dose 4 g)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        For patients with a history of recurrent otitis media (last episode within 6 months) or recent antibiotic therapy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" colspan=\"2\">",
"        For patients without penicillin allergy (two agents)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Ceftazidime",
"        <sup>",
"         &bull;",
"        </sup>",
"        <strong>",
"         OR",
"        </strong>",
"       </td>",
"       <td>",
"        150 mg/kg per day divided every 8 hours (maximum daily dose 6 g)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Cefepime",
"        <sup>",
"         &bull;",
"        </sup>",
"        <strong>",
"         OR",
"        </strong>",
"       </td>",
"       <td>",
"        150 mg/kg per day divided every 8 hours (maximum daily dose 4 g)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist3_start\">",
"        Piperacillin-tazobactam",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td class=\"sublist_other_start\">",
"        300 mg/kg per day of piperacillin component divided every 6 or 8 hours (maximum daily dose 16 g of piperacillin component)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist3\" colspan=\"2\">",
"        <strong>",
"         PLUS",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Vancomycin",
"        <sup>",
"         &bull;&Delta;",
"        </sup>",
"       </td>",
"       <td>",
"        60 mg/kg per day divided every 6 hours (maximum daily dose 4 g)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" colspan=\"2\">",
"        For patients with potential severe hypersensitivity (ie, anaphylaxis) to beta-lactam antibiotics (eg, penicillin, cephalosporin)",
"        <sup>",
"         &loz;",
"        </sup>",
"        (two agents )",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist3_start\">",
"        Aztreonam",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td class=\"sublist_other_start\">",
"        120 mg/kg per day divided every 6 hours (maximum daily dose 8 g)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist3\" colspan=\"2\">",
"        <strong>",
"         PLUS",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Vancomycin",
"        <sup>",
"         &bull;&Delta;",
"        </sup>",
"       </td>",
"       <td>",
"        60 mg/kg per day divided every 6 hours (maximum daily dose 4 g)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" colspan=\"2\">",
"        For patients with non-anaphylactic hypersensitivity to penicillins (two agents)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Ceftazidime",
"        <sup>",
"         &bull;",
"        </sup>",
"        <strong>",
"         OR",
"        </strong>",
"       </td>",
"       <td>",
"        150 mg/kg per day divided every 8 hours (maximum daily dose 6 g)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist3_start\">",
"        Cefepime",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td class=\"sublist_other_start\">",
"        150 mg/kg per day divided every 8 hours (maximum daily dose 4 g)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist3\" colspan=\"2\">",
"        <strong>",
"         PLUS",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Vancomycin",
"        <sup>",
"         &bull;&Delta;",
"        </sup>",
"       </td>",
"       <td>",
"        60 mg/kg per day divided every 6 hours (maximum daily dose 4 g)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Table contains suggested antibiotic options for broad-spectrum initial empirical treatment. Consider local resistance data, including prevalence of extended-spectrum beta-lactamase (ESBL)-producing organisms that may require alternate empiric coverage, including a carbapenem.",
"     <strong>",
"      Selection and/or dosing should be modified based on the results of culture and sensitivity testing.",
"     </strong>",
"     See text.",
"     <br/>",
"     <span class=\"bullet\">",
"      &bull;",
"     </span>",
"     Dosage modification for renal insufficiency is necessary. See drug information topic.",
"     <br/>",
"     &Delta; Monitor blood levels to insure efficacy and avoid toxicity.",
"     <br/>",
"     <span class=\"lozenge\">",
"      &loz;",
"     </span>",
"     Rapid desensitization and use of first-line agents may be preferred if feasible.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
